--------------------------------------------------------
--  DDL for View STD_SPEC
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "SYSTEM"."STD_SPEC" ("PRDLST_CD", "PRDLST_CD_NM", "TEST_ITEM_CD", "TEST_ITEM_NM", "ATTRB_SEQ", "PIAM_KOR_NM", "UPDT_PRVNS", "LAST_UPDT_DTM", "VALD_BEGN_DT", "VALD_END_DT", "RESULT_TYPE", "RESULT_TYPE_CD_NM", "STD_VAL", "SPEC_VAL_SUMUP", "UNIT", "UNIT_NM", "VALID_POSITION", "STD_LVAL", "STD_HVAL", "LVAL_TYPE", "LVAL_TYPE_CD_NM", "HVAL_TYPE", "HVAL_TYPE_CD_NM", "MCRRGNSM_2N", "MCRRGNSM_2M", "MCRRGNSM_2C", "MCRRGNSM_3M", "STD_FIT_VAL", "STD_FIT_VAL_CD_NM", "STD_UNFIT_VAL", "STD_UNFIT_VAL_CD_NM", "LOQ_HVAL", "LOQ_LVAL", "INJRY_YN", "FNPRT_ITM_INCLS_YN", "INDV_SPEC_SEQ", "CMMN_SPEC_CD", "NTR_PRSEC_ITM_YN", "MONTRNG_TESTITM_YN", "EMPHS_PRSEC_TESTITM_YN", "RVLV_ELSE_TESTITM_YN", "SPEC_GUBUN_CD", "KFDA_YN", "TEST_STD_NO", "CREATER_ID", "CREATE_DATE", "DEPT_CD", "REV_NO", "FEE", "FEE_GROUP_NO") AS 
  SELECT                                                          -- 품목및 항목정보
         PRDLST_CD 품목분류코드,
          PRDLST_CD_NM 품목명,
          TESTITM_CD AS 시험항목코드,
          TESTITM_NM 시험항목명,
          ATTRB_SEQ 단서조항일련번호,
          PIAM_KOR_NM 단서조항명,
          UPDT_PRVNS 수정사유,
          LAST_UPDT_DTM 최종수정일시                   --,SORC        출처
                                          ,
          VALD_BEGN_DT 유효개시일,
          VALD_END_DT 유효종료일                                  -- 기준정보
                                     ,
          JDGMNT_FOM_CD 판정형식,
          A079_FNPRT_CD_NM 판정형식명,
          SPEC_VAL 기준규격,
          SPEC_VAL_SUMUP 기준규격요약,
          UNIT_CD 단위코드,
          UNIT_NM 단위명,
          VALD_MANLI 유효자리수,
          MIMM_VAL 최소값,
          MXMM_VAL 최대값,
          MIMM_VAL_DVS_CD 최소값구분코드,
          A080_FNPRT_CD_NM 최소값구분명,
          MXMM_VAL_DVS_CD 최대값구분코드,
          A081_FNPRT_CD_NM 최대값구분명,
          MCRRGNSM_2N 미생물2N,
          MCRRGNSM_2M 미생물2M,
          MCRRGNSM_2C 미생물2C,
          MCRRGNSM_3M 미생물3M,
          CHOIC_FIT 선택접합코드,
          A082_CF_FNPRT_CD_NM 선택적합값명,
          CHOIC_IMPROPT 선택부적합코드,
          A082_CI_FNPRT_CD_NM 선택부적합명,
          LOQ_HVAL 정량상한값,
          LOQ_LVAL 정량하한값                                     -- 부가정보
                                  ,
          INJRY_YN 위해여부,
          FNPRT_ITM_INCLS_YN 세부항목포함여부,
          INDV_SPEC_SEQ 기준일련번호,
          '' 기준규격종류코드,
          NTR_PRSEC_ITM_YN 자품검사시험항목여부,
          MONTRNG_TESTITM_YN 감시시험항목여부,
          EMPHS_PRSEC_TESTITM_YN 중점검사시험항목여부,
          RVLV_ELSE_TESTITM_YN 공전외시험항목여부         -- 별도 추가 정보
                                                          ,
          'I' 기준규격구분코드,
          KFDA_YN 식약처여부,
          'I01' 기준일련번호,
          CREATER_ID 생성자,
          CREATE_DATE 생성일,
          DEPT_CD 부서코드,
          '001' 개정번호,
          FEE 수수료,
          FEE_GROUP_NO 수수료그룹번호
     FROM INDV_SPEC
    WHERE     KFDA_YN = 'Y'
          AND VALD_BEGN_DT <= TO_CHAR (SYSDATE, 'YYYYMMDD')
          AND VALD_END_DT >= TO_CHAR (SYSDATE, 'YYYYMMDD')
   UNION
   SELECT                                                          -- 품목및 항목정보
         PRDLST_CD 품목분류코드,
          PRDLST_CD_NM 품목명,
          TESTITM_CD AS 시험항목코드,
          TESTITM_NM 시험항목명,
          ATTRB_SEQ 단서조항일련번호,
          PIAM_KOR_NM 단서조항명,
          UPDT_PRVNS 수정사유,
          LAST_UPDT_DTM 최종수정일시                   --,SORC        출처
                                          ,
          VALD_BEGN_DT 유효개시일,
          VALD_END_DT 유효종료일                                  -- 기준정보
                                     ,
          JDGMNT_FOM_CD 판정형식,
          A079_FNPRT_CD_NM 판정형식명,
          SPEC_VAL 기준규격,
          SPEC_VAL_SUMUP 기준규격요약,
          UNIT_CD 단위코드,
          UNIT_NM 단위명,
          VALD_MANLI 유효자리수,
          MIMM_VAL 최소값,
          MXMM_VAL 최대값,
          MIMM_VAL_DVS_CD 최소값구분코드,
          A080_FNPRT_CD_NM 최소값구분명,
          MXMM_VAL_DVS_CD 최대값구분코드,
          A081_FNPRT_CD_NM 최대값구분명,
          MCRRGNSM_2N 미생물2N,
          MCRRGNSM_2M 미생물2M,
          MCRRGNSM_2C 미생물2C,
          MCRRGNSM_3M 미생물3M,
          CHOIC_FIT 선택접합코드,
          A082_CF_FNPRT_CD_NM 선택적합값명,
          CHOIC_IMPROPT 선택부적합코드,
          A082_CI_FNPRT_CD_NM 선택부적합명,
          '' 정량상한값,
          '' 정량하한값                                           -- 부가정보
                            ,
          INJRY_YN 위해여부,
          FNPRT_ITM_INCLS_YN 세부항목포함여부,
          CMMN_SPEC_SEQ 기준일련번호,
          CMMN_SPEC_CD 기준규격종류코드,
          NTR_PRSEC_ITM_YN 자품검사시험항목여부,
          MONTRNG_TESTITM_YN 감시시험항목여부,
          EMPHS_PRSEC_TESTITM_YN 중점검사시험항목여부,
          RVLV_ELSE_TESTITM_YN 공전외시험항목여부         -- 별도 추가 정보
                                                          ,
          'C' 기준규격구분코드,
          'Y' 식약처여부,
          'I01' 기준일련번호,
          '' 생성자,
          '' 생성일,
          '' 부서코드,
          '001' 개정번호,
          FEE 수수료,
          '' 수수료그룹번호
     FROM CMMN_SPEC
    WHERE     1 = 1
          AND VALD_BEGN_DT <= TO_CHAR (SYSDATE, 'YYYYMMDD')
          AND VALD_END_DT >= TO_CHAR (SYSDATE, 'YYYYMMDD')
 
 
;
