--  DDL for Procedure ADD_MTLR_INFO
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "SYSTEM"."ADD_MTLR_INFO" (   
    h_mtlr_info     IN  VARCHAR2,   
    m_mtlr_info     IN  VARCHAR2,   
    item_nm         IN  VARCHAR2,   
    spec1           IN  VARCHAR2,
    spec2           IN  VARCHAR2,
    spec_etc        IN  VARCHAR2,
    unit            IN  VARCHAR2,   
    etc             IN  VARCHAR2,   
    create_dept     IN  VARCHAR2,   
    user_id         IN  VARCHAR2,
    use             IN  VARCHAR2,   
    use_flag        IN  VARCHAR2,
    content         IN  VARCHAR2,
    max_mtlr_no     OUT  VARCHAR2    
)   
IS 
    MAX_M_NO VARCHAR2(6); 
           
BEGIN  
  
    INSERT INTO MTLR_INFO   
    (   
        MTLR_NO,
        H_MTLR_INFO,
        M_MTLR_INFO,
        item_nm,
        SPEC1,
        SPEC2,
        SPEC_ETC,
        UNIT,
        ETC,
        CREATE_DATE,
        CREATE_DEPT,
        CREATER_ID,
        USE,
        USE_FLAG,
        CONTENT,
        MASTER_YN   
    )   
    VALUES  
    (   
        (SELECT LPAD(NVL(MAX(MTLR_NO),0)+1,6,0) FROM MTLR_INFO), 
        h_mtlr_info, 
        m_mtlr_info, 
        item_nm, 
        spec1, 
        spec2,
        spec_etc,
        unit, 
        etc, 
        SYSDATE, 
        create_dept, 
        user_id, 
        use, 
        use_flag, 
        content,
        'N'  
    ); 
    
    COMMIT;
        
 select NVL(MAX(MTLR_NO),0) INTO MAX_M_NO --no얻어오기
  from MTLR_INFO; 
    
  max_mtlr_no :=  MAX_M_NO;

EXCEPTION
    WHEN OTHERS THEN
        ROLLBACK;
        DBMS_OUTPUT.PUT_LINE(SQLERRM||'에러 발생 ');
          
END ADD_MTLR_INFO;
 
 

