--  DDL for Procedure REQ_DATA_DELETE
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "SYSTEM"."REQ_DATA_DELETE" (
	P_REQ_CLASS IN VARCHAR2
)
IS

	CURSOR REQ_CUR
  IS
  SELECT TEST_REQ_SEQ FROM TEST_REQ WHERE REQ_CLASS = P_REQ_CLASS;

	V_SEQ VARCHAR2(10);

BEGIN

	OPEN REQ_CUR;
  
  	LOOP
    	
      FETCH REQ_CUR INTO V_SEQ;
      
      EXIT WHEN REQ_CUR%NOTFOUND;
  
  		DELETE SPLORE_PICK_LT WHERE PICK_NO IN (SELECT PICK_NO FROM SPLORE_PICK WHERE TEST_REQ_SEQ = V_SEQ);
