  		DELETE TEST_REPORT WHERE TEST_SAMPLE_SEQ IN(SELECT TEST_SAMPLE_SEQ FROM TEST_SAMPLE WHERE TEST_REQ_SEQ = V_SEQ);
      DELETE TEST_REPORT_ATTACH WHERE TEST_SAMPLE_SEQ IN(SELECT TEST_SAMPLE_SEQ FROM TEST_SAMPLE WHERE TEST_REQ_SEQ = V_SEQ);
      DELETE TEST_SAMPLE_ATTACH WHERE TEST_SAMPLE_SEQ IN(SELECT TEST_SAMPLE_SEQ FROM TEST_SAMPLE WHERE TEST_REQ_SEQ = V_SEQ);
      DELETE TEST_SAMPLE_DISUSE WHERE TEST_SAMPLE_SEQ IN(SELECT TEST_SAMPLE_SEQ FROM TEST_SAMPLE WHERE TEST_REQ_SEQ = V_SEQ);
      DELETE TEST_SAMPLE_ITEM_ATTACH WHERE TEST_SAMPLE_SEQ IN(SELECT TEST_SAMPLE_SEQ FROM TEST_SAMPLE WHERE TEST_REQ_SEQ = V_SEQ);
      DELETE TEST_SAMPLE_ITEM_HISTORY WHERE TEST_SAMPLE_SEQ IN(SELECT TEST_SAMPLE_SEQ FROM TEST_SAMPLE WHERE TEST_REQ_SEQ = V_SEQ);
  
			DELETE AUDIT_TRAIL WHERE TEST_REQ_SEQ = V_SEQ;
      DELETE ORG_COMMISSION_DEPOSIT WHERE TEST_REQ_SEQ = V_SEQ;
      DELETE REPORT_DOC WHERE TEST_REQ_SEQ = V_SEQ;
      DELETE REPORT_PUBLISH_LOG WHERE TEST_REQ_SEQ = V_SEQ;
      DELETE REPORT_SAMPLE WHERE TEST_REQ_SEQ = V_SEQ;
      DELETE REPORT_SAMPLE_ITEM WHERE TEST_REQ_SEQ = V_SEQ;
      DELETE REPORT_SAMPLE_ITEM_PL WHERE TEST_REQ_SEQ = V_SEQ;
      DELETE REPORT_SAMPLE_PL WHERE TEST_REQ_SEQ = V_SEQ;
      DELETE SAMPLE_HISTORY WHERE TEST_REQ_SEQ = V_SEQ;
      DELETE SPLORE_PICK WHERE TEST_REQ_SEQ = V_SEQ;
      DELETE TEST_COMMENT WHERE TEST_REQ_SEQ = V_SEQ;
      DELETE TEST_ENVIRONMENT WHERE TEST_REQ_SEQ = V_SEQ;
      DELETE TEST_REQ WHERE TEST_REQ_SEQ = V_SEQ;
      DELETE TEST_REQ_ATTACH WHERE TEST_REQ_SEQ = V_SEQ;
