      DELETE TEST_SAMPLE WHERE TEST_REQ_SEQ = V_SEQ;
      DELETE TEST_SAMPLE_ITEM WHERE TEST_REQ_SEQ = V_SEQ;

			
    
  	END LOOP;
    
  CLOSE REQ_CUR;

END;

/
--------------------------------------------------------
--  DDL for Procedure UPDATE_TEST_STATE
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "SYSTEM"."UPDATE_TEST_STATE" (
    P_TEST_REQ_SEQ IN VARCHAR2,
    P_TEST_SAMPLE_SEQ IN VARCHAR2,
    P_TEST_ITEM_SEQ   IN VARCHAR2,
    P_STATE           IN VARCHAR2,
    P_RESULT_INPUT_TYPE IN VARCHAR2 := NULL
    )
IS
    V_SAMPLE_STATE VARCHAR2(1);
    V_COUNT        NUMBER;
    V_JDG_TYPE     VARCHAR2(6);
BEGIN
    /* 결과입력완료된 의뢰의 재접수에 대한 처리 */
    IF P_STATE IN ('D', 'E', 'F') THEN
        UPDATE TEST_SAMPLE_ITEM
        SET STATE = P_STATE
        WHERE TEST_SAMPLE_SEQ = P_TEST_SAMPLE_SEQ
        AND TEST_ITEM_SEQ = P_TEST_ITEM_SEQ
        AND STATE NOT IN ('F');

        /* 검체의 모든 항목이 결과승인완료(F)일 경우 현재 진행상태를 리턴 */
        SELECT DECODE(MIN(STATE),'F',P_STATE,MIN(STATE))
        INTO V_SAMPLE_STATE
        FROM TEST_SAMPLE_ITEM
        WHERE TEST_SAMPLE_SEQ = P_TEST_SAMPLE_SEQ ;
    ELSE
        /* 결과 승인대기 및 승인완료가 아닐 경우 결과입력완료 항목은 제외 */
        UPDATE TEST_SAMPLE_ITEM
        SET STATE = P_STATE
        WHERE TEST_SAMPLE_SEQ = P_TEST_SAMPLE_SEQ
        AND TEST_ITEM_SEQ = P_TEST_ITEM_SEQ
        AND STATE NOT IN ('C');

        /* 검체의 모든 항목이 결과입력완료(C)일 경우 현재 진행상태를 리턴 */
        SELECT DECODE(MIN(STATE),'C',P_STATE,MIN(STATE))
        INTO V_SAMPLE_STATE
        FROM TEST_SAMPLE_ITEM
        WHERE TEST_SAMPLE_SEQ = P_TEST_SAMPLE_SEQ ;
    END IF;

    IF P_STATE = V_SAMPLE_STATE THEN
        UPDATE TEST_SAMPLE
        SET STATE = P_STATE
        ,DEPT_APPR_FLAG = CASE WHEN P_STATE = 'F' THEN  'Y' ELSE 'N' END
        ,RESULT_INPUT_TYPE = NVL(P_RESULT_INPUT_TYPE,RESULT_INPUT_TYPE)
        WHERE TEST_SAMPLE_SEQ = P_TEST_SAMPLE_SEQ;
    END IF;

    SELECT MIN(STATE)
    INTO V_SAMPLE_STATE
    FROM TEST_SAMPLE
    WHERE TEST_REQ_SEQ = P_TEST_REQ_SEQ;

    IF P_STATE = V_SAMPLE_STATE THEN
        IF P_STATE = 'F' THEN
            UPDATE TEST_REQ
            SET STATE = P_STATE ,
            DEPT_APPR_DATE  = TO_CHAR(SYSDATE, 'YYYYmmdd'),
            DEPT_APPR_ID = (
            									SELECT
                                MAX(APPR_ID) KEEP(DENSE_RANK LAST ORDER BY APPR_NO)
                              FROM APPR_LINE
                              WHERE TEST_REQ_SEQ = P_TEST_REQ_SEQ
                              GROUP BY TEST_REQ_SEQ
                            ),
        		RETURN_FLAG = 'N'
            WHERE TEST_REQ_SEQ = P_TEST_REQ_SEQ;
        ELSE
            UPDATE TEST_REQ
            SET STATE = P_STATE,
            RETURN_FLAG = 'N'
            WHERE TEST_REQ_SEQ = P_TEST_REQ_SEQ;
        END IF;
    END IF;

END UPDATE_TEST_STATE;

