/
--------------------------------------------------------
--  DDL for Function GET_ACC_TEST_REQ_NO
--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "SYSTEM"."GET_ACC_TEST_REQ_NO" (V_GUBUN IN VARCHAR2 , V_PARAM IN VARCHAR2 )
RETURN VARCHAR2
IS
    V_TEST_REQ_NO VARCHAR2(20);
    V_EX_CODE1 VARCHAR2(20);
    V_EX_CODE2 VARCHAR2(20);
    V_REQ_CLASS VARCHAR2(20);
BEGIN
    IF V_GUBUN = '1' THEN
        SELECT NVL(MAX(C.EX_CODE1),'XX') INTO V_EX_CODE1
        FROM COMMON_CODE_DETAIL C
    	WHERE C.CODE = V_PARAM AND C.PRE_CODE = 'C70';
        SELECT NVL(MAX(C.EX_CODE2),'XX') INTO V_EX_CODE2
        FROM COMMON_CODE_DETAIL C
    	WHERE C.CODE = V_PARAM AND C.PRE_CODE = 'C70';
      V_REQ_CLASS := V_PARAM;
    ELSIF V_GUBUN = '2' THEN
        SELECT NVL(MAX(C.EX_CODE1),'XX') INTO V_EX_CODE1
        FROM TEST_REQ TR, COMMON_CODE_DETAIL C
        WHERE TR.REQ_CLASS = C.CODE AND TR.TEST_REQ_SEQ = V_PARAM;
        SELECT NVL(MAX(C.EX_CODE2),'XX') INTO V_EX_CODE2
        FROM TEST_REQ TR, COMMON_CODE_DETAIL C
        WHERE TR.REQ_CLASS = C.CODE AND TR.TEST_REQ_SEQ = V_PARAM;
        SELECT NVL(MAX(REQ_CLASS),'XX') INTO V_REQ_CLASS
        FROM TEST_REQ
        WHERE TEST_REQ_SEQ = V_PARAM;
    END IF;


		IF (V_EX_CODE1 = 'E' OR V_EX_CODE1 = 'F') THEN
        SELECT NVL(MAX(V_EX_CODE1||'-'||TO_CHAR(SYSDATE,'YY')||'-'||V_EX_CODE2||LPAD(TO_NUMBER(SUBSTR(TEST_REQ_NO,7,4))+1,4,'0')),V_EX_CODE1||'-'||TO_CHAR(SYSDATE,'YY')||'-'||V_EX_CODE2||'0001')
            INTO V_TEST_REQ_NO
        FROM TEST_REQ
        WHERE REQ_CLASS = V_REQ_CLASS
                AND SUBSTR(TEST_REQ_NO,3,2) = TO_CHAR(SYSDATE,'YY');

     ELSIF(V_EX_CODE1 = 'FD') THEN
        SELECT NVL(MAX(V_EX_CODE1||'-'||TO_CHAR(SYSDATE,'YY')||'-'||V_EX_CODE2||LPAD(TO_NUMBER(SUBSTR(TEST_REQ_NO,8,4))+1,4,'0')),V_EX_CODE1||'-'||TO_CHAR(SYSDATE,'YY')||'-'||V_EX_CODE2||'0001')
            INTO V_TEST_REQ_NO
        FROM TEST_REQ
        WHERE REQ_CLASS IN ('C70021')
                AND SUBSTR(TEST_REQ_NO,4,2) = TO_CHAR(SYSDATE,'YY');

    ELSIF ((V_EX_CODE1 = 'K' OR V_EX_CODE1 = 'D') AND V_EX_CODE2 = '1') THEN
        SELECT NVL(MAX(V_EX_CODE1||'-'||TO_CHAR(SYSDATE,'YY')||'-'||V_EX_CODE2||LPAD(TO_NUMBER(SUBSTR(TEST_REQ_NO,7,4))+1,4,'0')),V_EX_CODE1||'-'||TO_CHAR(SYSDATE,'YY')||'-'||V_EX_CODE2||'0001')
            INTO V_TEST_REQ_NO
        FROM TEST_REQ
        WHERE REQ_CLASS IN ('C70014','C70015')
                AND SUBSTR(TEST_REQ_NO,3,2) = TO_CHAR(SYSDATE,'YY');

    ELSIF ((V_EX_CODE1 = 'K' OR V_EX_CODE1 = 'D') AND V_EX_CODE2 = '2') THEN
        SELECT NVL(MAX(V_EX_CODE1||'-'||TO_CHAR(SYSDATE,'YY')||'-'||V_EX_CODE2||LPAD(TO_NUMBER(SUBSTR(TEST_REQ_NO,7,4))+1,4,'0')),V_EX_CODE1||'-'||TO_CHAR(SYSDATE,'YY')||'-'||V_EX_CODE2||'0001')
            INTO V_TEST_REQ_NO
        FROM TEST_REQ
        WHERE REQ_CLASS IN ( 'C70017', 'C70019')
                AND SUBSTR(TEST_REQ_NO,3,2) = TO_CHAR(SYSDATE,'YY');

    ELSIF ((V_EX_CODE1 = 'K' OR V_EX_CODE1 = 'D') AND V_EX_CODE2 = '3') THEN
        SELECT NVL(MAX(V_EX_CODE1||'-'||TO_CHAR(SYSDATE,'YY')||'-'||V_EX_CODE2||LPAD(TO_NUMBER(SUBSTR(TEST_REQ_NO,7,4))+1,4,'0')),V_EX_CODE1||'-'||TO_CHAR(SYSDATE,'YY')||'-'||V_EX_CODE2||'0001')
            INTO V_TEST_REQ_NO
        FROM TEST_REQ
        WHERE REQ_CLASS IN ( 'C70018')
                AND SUBSTR(TEST_REQ_NO,3,2) = TO_CHAR(SYSDATE,'YY');

    ELSIF(V_EX_CODE1 = 'A' OR V_EX_CODE1 = 'R') THEN
        SELECT NVL(MAX(V_EX_CODE1||'-'||TO_CHAR(SYSDATE,'YY')||'-'||V_EX_CODE2||LPAD(TO_NUMBER(SUBSTR(TEST_REQ_NO,7,4))+1,4,'0')),V_EX_CODE1||'-'||TO_CHAR(SYSDATE,'YY')||'-'||V_EX_CODE2||'0001')
            INTO V_TEST_REQ_NO
        FROM TEST_REQ
        WHERE REQ_CLASS IN ('C70020', 'C70022')
                AND SUBSTR(TEST_REQ_NO,3,2) = TO_CHAR(SYSDATE,'YY');
    END IF;

  RETURN (V_TEST_REQ_NO);
END;

