--  DDL for Function GET_PRDLST_CD
--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "SYSTEM"."GET_PRDLST_CD" 
  RETURN VARCHAR2
IS
    v_tmp VARCHAR(14);

  /******************************************************************************
  NAME:       GET_PRDLST_CD
  자가품목코드를 생성하여 리턴
    
  ******************************************************************************/
     BEGIN
        
     
        SELECT 
            'PL000000' || LPAD(NVL(SUBSTR(MAX(PRDLST_CD),9,14)+1,1) ,6, 0) INTO v_tmp
        FROM PRDLST_CL
        WHERE KFDA_YN = 'N'
        AND LV = 'X'; 
             

        RETURN(v_tmp);


  END;
 
 

/
--------------------------------------------------------
--  DDL for Function GET_PRDLST_GUBUN_CD
--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "SYSTEM"."GET_PRDLST_GUBUN_CD" 
  RETURN VARCHAR2
IS
    v_tmp VARCHAR(14);
    v_tmpCode VARCHAR(1);
    v_tmpNum NUMBER(3);

  /******************************************************************************
  NAME:       GET_PRDLST_GUBUN
  품목분류코드를 생성하여 리턴
  V_GUBUN_CD : 대분류, 중분류 구분  
  ******************************************************************************/
     BEGIN
        
         

         SELECT 
             NVL(SUBSTR(MAX(PRDLST_CD),3,2),'A0') INTO v_tmp
         FROM PRDLST_CL
         WHERE KFDA_YN = 'N'
         AND LV = 'X'; 

               
         v_tmpCode := SUBSTR(v_tmp,1,1);
         v_tmpNum := SUBSTR(v_tmp,2,1);
         
         IF v_tmpNum = 9 THEN
                v_tmp := CHR(ASCII(v_tmpCode) + 1) || 1;
         ELSE
            v_tmp := v_tmpCode || TO_CHAR(v_tmpNum + 1);
            
         END IF;
         
         v_tmp := RPAD('PL' || v_tmp,14,0);
         --DBMS_OUTPUT.PUT_LINE(v_tmp);

        RETURN(v_tmp);


  END;
 
 

