/
--------------------------------------------------------
--  DDL for Function GET_STATE_NM
--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "SYSTEM"."GET_STATE_NM" (V_STATE_CD VARCHAR2, V_FLAG VARCHAR2, SIMPLE_FLAG VARCHAR2) RETURN VARCHAR2 IS
VN_STATE_NM VARCHAR2(40);
/******************************************************************************
   NAME:       GET_STATE_NM
   진행상태명 조회
******************************************************************************/
BEGIN
IF SIMPLE_FLAG = 'N' THEN
        IF V_STATE_CD = 'A' THEN VN_STATE_NM := '접수대기' ;
        ELSIF  V_STATE_CD = 'B' THEN VN_STATE_NM := '접수완료'  ;
        ELSIF  V_STATE_CD = 'C' THEN VN_STATE_NM := '결과입력완료'  ;
        ELSIF  V_STATE_CD = 'D' THEN VN_STATE_NM := '결과확인완료' ;
        ELSIF  V_STATE_CD = 'E' THEN VN_STATE_NM := '결과승인대기'  ;
        ELSIF  V_STATE_CD = 'F' THEN VN_STATE_NM := '결과승인완료' ;
        ELSIF  V_STATE_CD = 'G' THEN VN_STATE_NM := '성적서작성완료'  ;
        ELSIF  V_STATE_CD = 'H' THEN VN_STATE_NM := '성적서발행완료'  ;
        ELSIF  V_STATE_CD = 'I' THEN VN_STATE_NM := '성적서승인완료'  ;
        ELSIF  V_STATE_CD = 'O' THEN VN_STATE_NM := '(주관)결과확인완료' ;
        ELSIF  V_STATE_CD = 'P' THEN VN_STATE_NM := '(주관)승인대기'  ;
        ELSIF  V_STATE_CD = 'Q' THEN VN_STATE_NM := '(주관)승인완료' ;
        ELSIF  V_STATE_CD = 'S' THEN VN_STATE_NM := '시험중지'  ;
        ELSIF  V_STATE_CD = 'Y' THEN VN_STATE_NM := '의뢰승인대기'  ;
        ELSIF  V_STATE_CD = 'Z' THEN VN_STATE_NM := '접수대기' ;
        END IF;
ELSE
        IF V_STATE_CD = 'A' THEN VN_STATE_NM := '민원접수' ;
        ELSIF  V_STATE_CD = 'B' THEN VN_STATE_NM := '접수완료'  ;
        ELSIF  V_STATE_CD = 'C' THEN VN_STATE_NM := '결과입력완료'  ;
        ELSIF  V_STATE_CD = 'D' THEN VN_STATE_NM := '결과확인완료' ;
        ELSIF  V_STATE_CD = 'E' THEN VN_STATE_NM := '결과승인대기'  ;
        ELSIF  V_STATE_CD = 'F' THEN VN_STATE_NM := '결과승인완료' ;
        ELSIF  V_STATE_CD = 'G' THEN VN_STATE_NM := '성적서작성완료'  ;
        ELSIF  V_STATE_CD = 'H' THEN VN_STATE_NM := '성적서발행완료'  ;
        ELSIF  V_STATE_CD = 'I' THEN VN_STATE_NM := '성적서승인완료'  ;
        ELSIF  V_STATE_CD = 'O' THEN VN_STATE_NM := '(주관)결과확인완료' ;
        ELSIF  V_STATE_CD = 'P' THEN VN_STATE_NM := '(주관)승인대기'  ;
        ELSIF  V_STATE_CD = 'Q' THEN VN_STATE_NM := '(주관)승인완료' ;
        ELSIF  V_STATE_CD = 'S' THEN VN_STATE_NM := '시험중지'  ;
        ELSIF  V_STATE_CD = 'Y' THEN VN_STATE_NM := '의뢰승인대기'  ;
        ELSIF  V_STATE_CD = 'Z' THEN VN_STATE_NM := '접수대기' ;
        END IF;
END IF;
    RETURN VN_STATE_NM;
END GET_STATE_NM
;

/
--------------------------------------------------------
--  DDL for Function GET_TEST_REQ_NO
--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "SYSTEM"."GET_TEST_REQ_NO" (V_GUBUN VARCHAR2, V_PARAM VARCHAR2)
    RETURN VARCHAR2
IS
    V_TEST_REQ_NO VARCHAR2(20);
    V_EX_CODE1 VARCHAR2(20);
    V_REQ_CLASS VARCHAR2(10);
BEGIN

/******************************************************************************
 V_GUBUN
 - 1 : V_PARAM(부서코드)
 - 2 : V_PARAM(의뢰번호)
******************************************************************************/
    IF V_GUBUN = '1' THEN
        SELECT NVL(EX_CODE1,'XX'), CODE INTO V_EX_CODE1, V_REQ_CLASS
        FROM COMMON_CODE_DETAIL
    	WHERE CODE = V_PARAM AND PRE_CODE = 'C70' AND USE_FLAG = 'Y';
    ELSIF V_GUBUN = '2' THEN
    		SELECT NVL(EX_CODE1,'XX'), CODE INTO V_EX_CODE1, V_REQ_CLASS
        FROM COMMON_CODE_DETAIL
        WHERE CODE = (SELECT REQ_CLASS FROM TEST_REQ WHERE TEST_REQ_SEQ = V_PARAM)
        AND PRE_CODE = 'C70' AND USE_FLAG = 'Y';
    ELSE
        V_EX_CODE1 := 'X';
        V_REQ_CLASS := 'X';
    END IF;

	SELECT
	TO_CHAR(SYSDATE, 'yy') || '-' || TO_CHAR(SYSDATE, 'mm') || '-' || V_EX_CODE1 ||
	LPAD(NVL(MAX(SUBSTR(TR.TEST_REQ_NO, 9, 4)),0)+1, 4, 0) INTO V_TEST_REQ_NO
	FROM TEST_REQ TR
	WHERE SUBSTR(TR.TEST_REQ_NO, 3, 2) = TO_CHAR(SYSDATE, 'yy')
	AND TR.REQ_CLASS = V_REQ_CLASS;

    RETURN(V_TEST_REQ_NO);

END;

