  CREATE OR REPLACE FUNCTION "SYSTEM"."SF_ITEM_LST" (

P_TEST_SAMPLE_SEQ IN VARCHAR2

) RETURN VARCHAR2 IS

    V_ITEM_COUNT NUMBER(3);
    V_TEST_ITEM_NAME VARCHAR2(100);
