/
--------------------------------------------------------
--  DDL for Function SF_ITEM_METHOD
--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "SYSTEM"."SF_ITEM_METHOD" (P_TEST_SAMPLE_SEQ IN VARCHAR2)

 RETURN VARCHAR2 IS
  O_ITEM_COUNT   NUMBER(3);
  O_TESTITM         VARCHAR2(100);
  O_TESTITM_LIST VARCHAR2(500);
  I                          NUMBER;
  
         
BEGIN
  /*==================================================
    항목의 시험방법 목록 및 카운트 반환
  ===================================================*/
  
   SELECT MIN(C.TEST_METHOD_NM) INTO O_TESTITM
       FROM TEST_SAMPLE_ITEM B, TEST_METHOD C
     WHERE B.TEST_METHOD = C.TEST_METHOD_NO(+)       
          AND B.TEST_METHOD IS NOT NULL
          AND B.TEST_SAMPLE_SEQ = P_TEST_SAMPLE_SEQ ;
  

 SELECT COUNT(*) INTO O_ITEM_COUNT
       FROM TEST_SAMPLE_ITEM B, TEST_METHOD C
     WHERE B.TEST_METHOD = C.TEST_METHOD_NO(+)       
          AND B.TEST_METHOD IS NOT NULL
          AND B.TEST_SAMPLE_SEQ = P_TEST_SAMPLE_SEQ ;
  
 
    O_TESTITM_LIST := O_TESTITM||' 등 '||O_ITEM_COUNT ||'종';
  

  
  RETURN(O_TESTITM_LIST);
  
  EXCEPTION
  WHEN NO_DATA_FOUND THEN
    RETURN('');
END SF_ITEM_METHOD;
 
 

/
--------------------------------------------------------
--  DDL for Function SF_METHOD_LST
--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "SYSTEM"."SF_METHOD_LST" (
P_TEST_REQ_SEQ IN VARCHAR2
) RETURN VARCHAR2 IS

    V_TEST_METHOD_NAME VARCHAR2(50);
    V_RETURN VARCHAR2(200);
    
    CURSOR METHOD_LIST IS
    SELECT DISTINCT TEST_METHOD_NM 
    FROM TEST_SAMPLE_ITEM SI, TEST_METHOD TM
    WHERE SI.TEST_METHOD = TM.TEST_METHOD_NO
    AND SI.TEST_REQ_SEQ = P_TEST_REQ_SEQ;	
  
BEGIN

    V_RETURN := '';    
    FOR METHOD_ROW IN METHOD_LIST LOOP
        V_RETURN := V_RETURN || METHOD_ROW.TEST_METHOD_NM || ', ';
    END LOOP;
    
    V_RETURN := SUBSTR(V_RETURN, 1, LENGTH(V_RETURN)-2);
    RETURN V_RETURN;  
END SF_METHOD_LST;
 
 

